    private void loadProductOffers(List<ProductCreateDTO> productCreateDTOList) {
        List<Product> productList = new ArrayList<>();
        for(ProductCreateDTO product : productCreateDTOList) {
            Optional<Product> productEntity = this.productService.getByNameEntity(product.getName());
            if(productEntity.isPresent()) {
                productList.add(productEntity.get());
            }  else {
                System.out.println("Fallo");
            }

        }

        ProductOffer productOffer_1 = new ProductOffer(1L,15.0,0,productList.get(0));
        ProductOffer productOffer_2 = new ProductOffer(2L,20.0,0,productList.get(1));
        ProductOffer productOffer_3 = new ProductOffer(3L,25.0,0,productList.get(2));
        ProductOffer productOffer_4 = new ProductOffer(4L,30.0,0,productList.get(3));
        ProductOffer productOffer_5 = new ProductOffer(5L,45.0,0,productList.get(4));

        productOfferService.createProductOffer(productOffer_1);
        productOfferService.createProductOffer(productOffer_2);
        productOfferService.createProductOffer(productOffer_3);
        productOfferService.createProductOffer(productOffer_4);
        productOfferService.createProductOffer(productOffer_5);

    }
